declare namespace ServiceError {
    type TCode = number | string | Symbol;
    type TMessage = string;
    type TData = any;

    type TErrorCatch = void | ServiceError.IErrorCatch | Promise<void | ServiceError.IErrorCatch>;

    interface IError {
        code: TCode;
        message: TMessage;
        data?: TData;
    }

    interface IErrorCatch extends IError {
        result?: number;
    }

    interface IErrorHandler {
        catchError(data: IError): TErrorCatch;
    }
}
